import { WORDS } from "./constants";

function generateRandomNumber() {
  min = Math.ceil(0);
  max = Math.floor(WORDS.length);

  return Math.floor((Math.random() * (max - min)) + min);
}

export function selectWord() {
  const a = generateRandomNumber();
  console.log(a);
  return WORDS[1];
}
